import './App.css';
import Header from './components/Header';
import Place from './components/Place';

function App() {
  return (
    <div className="App">
      <div>
        <Header/>
        <div className='places--scroll'>
          <Place />
          <Place />
        </div>
      </div>
    </div>
  );
}

export default App;
